import logo from './logo.svg';
import './App.css';
import productData from "./productData";
import {Header} from "./header";
import {Product} from "./product";
function App() {
    const ProductModal = productData.map(
        item => {
            return (
                <Product
                    item ={item}
                />

            )
        }
    )
    return (
            <div>
                <Header />
            </div>
        )
}



export default App;
